// src/components/Navbar.js
import React, { useState } from 'react';
import { Link } from 'react-scroll';
import './Navbar.css';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const handleHamburgerClick = () => {
    setIsOpen(!isOpen);
  };

  const closeMenu = () => {
    setIsOpen(false);
  };

  return (
    <nav className="navbar">
      <div className="nav-container">
        <Link to="hero" className="nav-logo" smooth={true} duration={500}>
          Avi Desai
        </Link>
        <ul className={`nav-menu ${isOpen ? 'active' : ''}`}>
          <li className="nav-item">
            <Link
              to="hero"
              className="nav-links"
              smooth={true}
              duration={500}
              onClick={closeMenu}
            >
              Home
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="bio"
              className="nav-links"
              smooth={true}
              duration={500}
              onClick={closeMenu}
            >
              Bio
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="experience"
              className="nav-links"
              smooth={true}
              duration={500}
              onClick={closeMenu}
            >
              Experience
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="projects"
              className="nav-links"
              smooth={true}
              duration={500}
              onClick={closeMenu}
            >
              Projects
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="contact"
              className="nav-links"
              smooth={true}
              duration={500}
              onClick={closeMenu}
            >
              Contact
            </Link>
          </li>
        </ul>
        <div className="hamburger-menu" onClick={handleHamburgerClick}>
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
